    return Object.freeze({
        insertNewMember
        ,getMemberById
        ,deleteAllMembers
        ,updateMembersName
        ,updateMembersSurname
        ,updateMembersEmail
        ,updateMembersPassword
        ,deleteMemberById
    })
}

